function ListGroup() {
    const myList = ['New York', 'Paris', 'London', 'Tokyo', 'Jaipur', 'Sydney'];

    return (
        <>
            <h1>My List.</h1>
            {myList.length === 0 && <p></p>}
            <ul className="list-group">
                {myList.map((item) => (<li key={item} className="list-group-item">{item}</li>))}
            </ul>
        </>
    )
}

export default ListGroup;
